import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card1 from "../components/cards/productCard";
import Card2 from "../components/cards/productCard2";
import Card3 from "../components/cards/productCard3";
import Card4 from "../components/cards/productCard4";
import Header from "../components/mainSection/header4"
import Grid from '@material-ui/core/Grid';
const useStyles = makeStyles({
    initial:{
        height: "100%",
        width: "100%"
    },
    firstRow:{
        height:"8%",
        width: "94%",
        margin: "20px"
    },
    secondRow:{
        height: "92%",
        width: "100%",
        padding: "30px"
    }
});
export default () => {
    const classes = useStyles();
    return(
        <Grid container className = {classes.initial} spacing = {3}>
            <Grid item className = {classes.firstRow}>
                <Header>"Create Your Profile"</Header>
            </Grid>
            <Grid item xs = {3}>
                <Card1></Card1>
            </Grid>
            <Grid item xs = {3}>
                <Card2></Card2>
            </Grid>
            <Grid item xs = {3}>
                <Card3></Card3>
            </Grid>
            <Grid item xs = {3}>
                <Card4></Card4>
            </Grid>
        </Grid>
    )
}
